import React, {useState} from 'react';
import logo from './logo.svg';
import AddButtonList from './components/AddList'
import List from './components/List'
import listSvg from  './assets/img/list.svg'
import plusSvg from  './assets/img/add.svg'
import doIt from  './assets/img/do-it.png'
import didIt from  './assets/img/did-it.gif'

import './css/reset.css';
import './css/index.min.css';
import './css/List.min.css';
import './css/AddList.min.css';

function App() {
  const [state, setState] = useState('HELLO WORLD');
  return (
    <div className="todo">
      <section className="todo__sidebar">
        <List items= {[
          { 
            icon: <img src={listSvg} alt="list icon"/>,
            name:'All tasks',
            active: true 
           }
        ]}
        isRemovable={false}/>
        <List items= {[
           {
            color: 'green',
            name:'Shoping list'
           },
           {
            color: 'green',
            name:'University'
           }
        ]}
        isRemovable/>
         <AddList />
      </section>
      <section className="todo__tasks">
      <img className ="shai"src={doIt} alt="list icon"/>
      </section>
    </div>
  );
}

export default App;
